import React from 'react';

const PaddockBoxStatus = (props) => {

return(
  <>
    <div className="paddock_name">{props.paddocks.name}</div>
    {props.paddocks.occupancy.length}
    <div className="paddock_capacity">{props.paddocks.capacity}</div>
    <div className="paddock_eats_meat" value={props.paddocks.containsCarnivores}></div>
  </>
);

}

export default PaddockBoxStatus;
